import '../styles/Rating.css'
import star from '...assets/star.svg'

function Rating (props){

    const RATING = new Array(5).fill(star);

    for(let i = 0 ; i < props.starsNumber ; i++){
        RATING[i] = <p>1</p>
    }

    return (
        <div>
            {RATING}
        </div>
    )
}

export default Rating
